webpackJsonp([0x81b8806e4260],{524:function(t,e){t.exports={pathContext:{group:[{node:{fields:{slug:"/058-nestjs/"},html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/665536373&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>Надавно начал небольшой проект - прототип или MVP для проверки бизнес идеи. Задача пока технически не сложная, решил попробовать какой-нибудь новый для себя Node.js фреймворк. После небольшого исследования, выделилось два кандидата Nest.js и Loopback 4.</p>\n<p>Взял Nest.js. В основе хорошие дизайн-паттерны и заявка на грамотную архитектуру. Расскажу о своём небольшом опыте работы с этим фреймворком.</p>\n<ul>\n<li><a href="https://nestjs.com">https://nestjs.com</a></li>\n<li><a href="https://techtrain.ru/?utm_source=partner&#x26;utm_medium=5minphp&#x26;utm_campaign=techtrain2019&#x26;utm_content=common">https://techtrain.ru/</a></li>\n</ul>',excerpt:"Надавно начал небольшой проект - прототип или MVP для проверки бизнес идеи. Задача пока технически не сложная, решил попробовать какой…",frontmatter:{title:"Nest.js",date:"August 14, 2019",featuredImage:null}}},{node:{fields:{slug:"/057-techtrain-richard-stallman-free-software/"},html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/658433429&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>24-25 августа 2019 в Санкт-Петербурге пройдёт IT-Фестиваль TechTrain.</p>\n<p>Фестиваль - это множество активностей под одной крышей: доклады, дискуссионные зоны, митапы, стенды IT сообществ и подкастов.</p>\n<p>Среди спикеров много громких имён, в частности мой глаз зацепился за два имени: Ричард Столлман (главный по свободному ПО), Джон Ромеро (гейм дизайнер, создавший атмосферу Wolfenstein 3D, Doom и Quake)!</p>\n<p>В связи с этим в этом выпуске подкаста сделаем небольшой экскурс в историю Ричарда Столлмана и Свободного программного обеспечения.</p>\n<p>Я обязательно буду на TechTrain, и у подкастов Пятиминутка React и Пятиминутка PHP даже будет свой стенд, приходите, пообщаемся!</p>\n<ul>\n<li><a href="https://techtrain.ru/?utm_source=partner&#x26;utm_medium=5minphp&#x26;utm_campaign=techtrain2019&#x26;utm_content=common">https://techtrain.ru/</a> - IT-ФЕСТИВАЛЬ TechTrain!</li>\n<li><a href="http://www.gnu.org/philosophy/free-sw.ru.html">http://www.gnu.org/philosophy/free-sw.ru.html</a> - Что такое свободная программа?</li>\n<li><a href="http://www.gnu.org/philosophy/open-source-misses-the-point.html">http://www.gnu.org/philosophy/open-source-misses-the-point.html</a> - Почему “открытый исходный текст” не передает понятия “свободная программа”</li>\n</ul>',excerpt:"24-25 августа 2019 в Санкт-Петербурге пройдёт IT-Фестиваль TechTrain. Фестиваль - это множество активностей под одной крышей: доклады…",frontmatter:{title:"TechTrain, Ричард Столлман и Свободное программное обеспечение",date:"July 30, 2019",featuredImage:null}}},{node:{fields:{slug:"/56-solid-book/"},html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/655630586&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>Порекомендую книгу о знаменитых SOLID принципах ООП с примерами на TypeScript: <a href="https://ota-solid.now.sh">https://ota-solid.now.sh</a></p>\n<p>Книга написала приятным и понятным языком, совсем не большая - я не напрягаясь прочитал за выходные. Помимо описания самих SOLID принципов, по каждому из них даются как идеальные примеры, так и примеры из реальной жизни, а также описаны антипаттерны, “запахи кода”, ограничения и подводные камни.</p>\n<p>Книга интерактивная, по мере чтения нужно будет отвечать на вопросы по только что пройденному материалу - эти мини-тесты очень хорошо помогают закрепить материал. Авторы Саша Беспоясов и Артём Самофалов проделали большой труд и хорошо поработали над материалом, чтобы сделать его доступным и полезным для читателей разного уровня подготовки!</p>\n<p>Исходники книги доступны на GitHub, поддержать проект можно на Patreon.</p>\n<ul>\n<li><a href="https://ota-solid.now.sh">https://ota-solid.now.sh</a></li>\n<li><a href="https://github.com/open-tech-authors">https://github.com/open-tech-authors</a></li>\n<li><a href="https://www.patreon.com/open_tech_authors">https://www.patreon.com/open<em>tech</em>authors</a></li>\n</ul>',excerpt:"Порекомендую книгу о знаменитых SOLID принципах ООП с примерами на TypeScript:  https://ota-solid.now.sh Книга написала приятным и понятным…",frontmatter:{title:"SOLID с примерами на TypeScript",date:"July 24, 2019",featuredImage:null}}},{node:{fields:{slug:"/55-gitlab-salary/"},html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/648023975&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>Компания GitLab с каждым годом набирает обороты. Как ни странно для OpenSource проекта, из него получился не плохой бизнес! Что интересно, в GitLab все внутренние процессы максимально открыты и описаны в публичном Handbook, включая вилки зарплат, принцип их построения и даже интерактивный калькулятор. Воспользуемся этим калькулятором, чтобы примерить зарплату фронтенд-разработчика в GitLab на себя.</p>\n<ul>\n<li><a href="https://about.gitlab.com/handbook/">https://about.gitlab.com/handbook/</a></li>\n<li><a href="https://about.gitlab.com/handbook/people-operations/global-compensation/calculator/">https://about.gitlab.com/handbook/people-operations/global-compensation/calculator/</a> - зарплатный калькулятор в GitLab</li>\n<li><a href="https://soundcloud.com/frontend-weekend/fw-94">https://soundcloud.com/frontend-weekend/fw-94</a> - Денис Мишунов в подкасте Frontend Weekend.</li>\n<li><a href="https://www.youtube.com/channel/UCW9pyonagDWGMCy7V_Kro6g">https://www.youtube.com/channel/UCW9pyonagDWGMCy7V_Kro6g</a> - JavaScript.Ninja от Ильи Климова</li>\n</ul>',excerpt:"Компания GitLab с каждым годом набирает обороты. Как ни странно для OpenSource проекта, из него получился не плохой бизнес! Что интересно, в…",frontmatter:{title:"Зарплаты в GitLab",date:"July 8, 2019",featuredImage:null}}},{node:{fields:{slug:"/54-youtube-screencasts/"},html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/641013810&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>Сегодня у меня небольшое объявление: у подкаста уже давно есть одноимённый YouTube канал.</p>\n<p>Но только этом году я попробовал записывать полноценные скринкасты: видео где показывается реализация какого-то алгоритма на JavaScript. Выбрал не самые простые темы, но интересные (по крайней мере мне). </p>\n<p>Что самое главное, постарался рассказать подробно и понятно, разбивая задачу на отдельные шаги, комментируя принимаемые решения, отвечая на собственные вопросы по ходу. Мне кажется, получилось не плохо, буду продолжать ещё.</p>\n<p>Подписывайтесь: <a href="https://www.youtube.com/channel/UCtcMCp5GwNdQuloP4v5slfw">https://www.youtube.com/channel/UCtcMCp5GwNdQuloP4v5slfw</a></p>',excerpt:"Сегодня у меня небольшое объявление: у подкаста уже давно есть одноимённый YouTube канал. Но только этом году я попробовал записывать…",frontmatter:{title:"Скринасты Пятиминутки React на YouTube",date:"June 23, 2019",featuredImage:null}}}],pathPrefix:"",first:!0,last:!1,index:1,pageCount:13,additionalContext:{}}}}});
